import React, { useState }from 'react';

export default function Card({
  newDice,
  player,
  player1TurnScores,
  player1TotalScore
}) {
  const diceImg = `${player}0${newDice}`
  const player1History = player1TurnScores.join(', ')

  console.log(diceImg)
  return(
    <div className="card">
      <h4>나</h4>
      <img className='dices' src={require(`./image/dice-${diceImg}.png`)} alt={diceImg}/>
      <p>총점</p>
      <p>{player1TotalScore}</p>
      <p>기록</p>
      <p>{player1History}</p>
    </div>
  )
}
